import { useEffect, useState } from "react";
import UserListItem from "./UserListItem";
import EditTenantModal from "./EditTenantModal";
import AddCircleIcon from "@mui/icons-material/AddCircle";
import { IconButton } from "@mui/material";

function Tenants(props) {
  const [userList, setUserList] = useState(undefined);
  const [newUserModalOpen, setNewUserModalOpen] = useState(false);

  const [editUserModalOpen, setEditUserModalOpen] = useState(false);
  const [selectedUser, setSelectedUser] = useState(undefined);

  useEffect(() => {
    const x = async () => {
      await new Promise((r) => setTimeout(r, 1000));
      setUserList([
        {
          fullName: "בצלאל סמוטריץ'",
          faceDataType: "image/jpeg",
          face: "",
        },
        {
          fullName: "איתמר בן גביר",
          faceDataType: "image/jpg",
          face: "",
        },
      ]);
    };

    x();
  }, []);

  return (
    <div className="d-flex flex-column" style={{ margin: "60px" }}>
      <p style={{ fontSize: "1.7em", fontWeight: "700" }}>דיירים</p>
      {userList !== undefined ? (
        userList.length > 0 ? (
          userList.map((user) => (
            <UserListItem
              key={user.fullName}
              name={user.fullName}
              data={user.face}
              dataType={user.faceDataType}
              onClick={() => {
                setEditUserModalOpen(true);
                setSelectedUser(user);
              }}
            />
          ))
        ) : (
          <p>אין דיירים</p>
        )
      ) : (
        <p>טוען רשימת דיירים...</p>
      )}
      <EditTenantModal
        newTenant
        openState={[newUserModalOpen, setNewUserModalOpen]}
      />
      <EditTenantModal
        openState={[editUserModalOpen, setEditUserModalOpen]}
        selectedUser={selectedUser}
        onClose={() => {
          setSelectedUser(undefined);
        }}
      />
      <IconButton
        aria-label="delete"
        className="position-absolute"
        style={{
          bottom: "50px",
          left: "50px",
          padding: "15px",
          backgroundColor: "rgb(34, 35, 56)",
        }}
        onClick={() => setNewUserModalOpen(true)}
      >
        <AddCircleIcon style={{ color: "white", fontSize: "1.5em" }} />
      </IconButton>
    </div>
  );
}

export default Tenants;
